import React from 'react';
import { Link } from 'react-router-dom';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';

const Navbar = ({ isAuthenticated, isAdmin }) => {
    return (
        <AppBar position="static">
            <Toolbar>
                <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
                    Mon Site
                </Typography>
                <Button color="inherit" component={Link} to="/">Accueil</Button>
                <Button color="inherit" component={Link} to="/profile">Profil</Button>
                <Button color="inherit" component={Link} to="/search">Recherche</Button>
                {isAdmin && <Button color="inherit" component={Link} to="/admin">Admin</Button>}
                {!isAuthenticated && <Button color="inherit" component={Link} to="/login">Connexion</Button>}
                {!isAuthenticated && <Button color="inherit" component={Link} to="/register">Inscription</Button>}
            </Toolbar>
        </AppBar>
    );
};

export default Navbar;
